import Navbar from './Navbar';
import Comp1 from './Componente1';
import Comp2 from './Componente2';
import { Footer } from './Footer';
import Wsp from './WhatsappPNG';
import Copyri from './Copyri';

const HOME = props =>(
    <>
      <Navbar/>
      <Comp1/>
      <Comp2/>
      <Footer/>
      <Copyri/>
      <Wsp/>
    </>
  )

function Home (){
    return(
    <>
        <Navbar/>
        <Comp1/>
        <Comp2/>
        <Footer/>
        <Copyri/>
        <Wsp/>
    </>
    )    
}

export default Home;
